My favorite Halloween vibe is what I like to call “Cozy Cottage Witch.” It’s a little bit natural autumnal decor mixed with some spooky touches. And that vibe is what I wanted to channel for our Halloween porch this year. Between the branches, dried hydrangeas and slew of pumpkins, I was pretty thrilled with it. Then, Micah added the pièce de résistance that totally took it over the top - watch to the end to see what I mean!
.
